import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from "./components/navigation/Header";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Header />
                <Route />
            </Routes>
        </BrowserRouter>
    );
}

export default App;
